import logo from "./logo.svg";
import "./App.scss";
import { DatePicker, Alert, Card } from "antd";
import {
  BrowserRouter as Router,
  Route,
  Link,
  BrowserRouter,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Link to = "/">Home</Link>
    <br />
    <Link to = "/Contact">Contact</Link>
    <br />
    <Link to = "/Users">Contact</Link>
    <br />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="contact" element={<Contact />} />
        <Route path="users" element={<Users />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

/* crear componentes */
function Home() {
  return <h2>Component Home works</h2>;
}

function Contact() {
  return <h2>Component Contact works</h2>;
}

function Users() {
  return <h2>Component Users works</h2>;
}

function NotFound() {
  return <h2>Component NotFound</h2>;
}

export default App;
